import { Route, Routes,BrowserRouter } from 'react-router-dom';
import './App.css';
import { Home } from './Screens/Home/Home';
import Navbar from './Components/Navbar/Navbar';
import Footer from './Components/Footer/Footer';
import Courses from './Screens/Courses/Courses';
import Error from './Components/Error/Error';
import React from 'react';
import Register from './Screens/Register/Register';
import Teacher from './Screens/Teacher/Teacher';
import About from './Screens/About/About';
import Pricing from './Screens/Pricing/Pricing';
import ScrollToTop from './Components/TopScroll';
import { NavIconProvider } from './Context/NavIcon';
import AdditionalLinks from './Screens/AdditionalLinks/AdditionalLinks';
import CoursesCategotries from './Screens/Courses/CoursesCategotries';
import ComputerCourses from './Screens/Courses/ComputerCourses';
import TutionCourses from './Screens/Courses/TutionCourses';

function App() {
  return (
    <>
    <NavIconProvider>
    <BrowserRouter>
    <ScrollToTop />
    <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/courses" element={<CoursesCategotries />} />
        <Route path="courses/computer-courses" element={<ComputerCourses />} />
        <Route path="/course/tuition-courses" element={<TutionCourses />} />
        <Route path="/course/language-courses" element={<LanguageCourses />} /> 
        <Route path="/teachers/:id" element={<Teacher />} />
        <Route path="/additionallinks/:id" element={<AdditionalLinks />} />
        <Route path="/register" element={<Register />} />
        <Route path="/about/fgcampus" element={<About />} />
        <Route path="/pricing" element={<Pricing />} />
        <Route path="*" element={<Error />} />
      </Routes>
      <Footer />
    </BrowserRouter>
    </NavIconProvider>
    </>
  )
}

export default App;
